import React from "react";

const Nav = () => {
  return (
    <div>
      <ul>
        <li>Menu 1</li>
        <li>Menu 2</li>
        <li>Menu 3</li>
        <li>Menu 4</li>
      </ul>
    </div>
  );
};

export default Nav;
